query SimpleProductList($limit: Int, $offset: Int) {
  products(limit: $limit, offset: $offset) {
    __typename
    _id
    media {
      __typename
      _id
      file {
        __typename
        _id
        url
      }
    }
    texts {
      __typename
      _id
      slug
      title
      subtitle
      description
    }
    ... on SimpleProduct {
      simulatedPrice {
        __typename
        _id
        price {
          __typename
          amount
          currency
        }
      }
    }
  }
}
